import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { ExternalLink, Github, Eye } from 'lucide-react';

const Projects: React.FC = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  const projects = [
    {
      title: 'Bored Ape Yacht Club Global Activations',
      description: 'Led major, global brand activations and narrative rollouts across the Bored Ape Yacht Club ecosystem. Managed a 12-person team driving cross-functional campaign strategies.',
      image: '/api/placeholder/400/250',
      technologies: ['Brand Activations', 'Team Leadership', 'Cross-functional Strategy', 'Community Management'],
      liveUrl: '#',
      githubUrl: '#',
      featured: true
    },
    {
      title: 'IMDb Podcast Network Launch',
      description: 'Developed and launched IMDb\'s first podcast network, including "Movies That Changed My Life" and "That Scene with Dan Patrick". Established new content verticals for the entertainment platform.',
      image: '/api/placeholder/400/250',
      technologies: ['Podcast Development', 'Content Strategy', 'Entertainment Marketing', 'Platform Launch'],
      liveUrl: '#',
      githubUrl: '#',
      featured: true
    },
    {
      title: 'Amazon Channels Social Strategy',
      description: 'Created and owned all paid (+$1MM budget) and organic social media for Amazon Channels. Led go-to-market strategy for tentpole series like Game of Thrones and Ray Donovan.',
      image: '/api/placeholder/400/250',
      technologies: ['Paid Social', 'Go-to-Market Strategy', 'Channel Marketing', 'Content Calendar'],
      liveUrl: '#',
      githubUrl: '#',
      featured: false
    },
    {
      title: '150+ Entertainment Videos',
      description: 'Produced and hosted 150+ videos spotlighting iconic film/TV moments and interviewing top creators across Oscars, Comic-Con, SXSW, and more.',
      image: '/api/placeholder/400/250',
      technologies: ['Video Production', 'Content Creation', 'Entertainment Marketing', 'Interview Production'],
      liveUrl: '#',
      githubUrl: '#',
      featured: false
    },
    {
      title: 'CryptoPunks Community Management',
      description: 'Managed crisis communications and community engagement for CryptoPunks, maintaining transparency and trust across a passionate and vocal community.',
      image: '/api/placeholder/400/250',
      technologies: ['Crisis Communications', 'Community Management', 'Web3 Marketing', 'Trust Building'],
      liveUrl: '#',
      githubUrl: '#',
      featured: false
    },
    {
      title: 'High-Profile Branded Content',
      description: 'Produced high-profile branded podcasts and videos for Amazon, Microsoft, and Nike with budgets up to $250K. Managed all phases of production across multiple concurrent projects.',
      image: '/api/placeholder/400/250',
      technologies: ['Content Production', 'Project Management', 'Client Relations', 'Budget Management'],
      liveUrl: '#',
      githubUrl: '#',
      featured: false
    }
  ];

  return (
    <section id="projects" className="py-32 bg-neutral-50 dark:bg-neutral-900">
      <div className="container-max px-4 sm:px-6 lg:px-8">
        <motion.div
          ref={ref}
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
        >
          {/* Section Header */}
          <div className="mb-20">
            <motion.div
              initial={{ opacity: 0, y: 20 }}
              animate={inView ? { opacity: 1, y: 0 } : {}}
              transition={{ duration: 0.8, delay: 0.1 }}
              className="text-sm font-medium tracking-widest uppercase text-neutral-500 dark:text-neutral-400 mb-4"
            >
              Work
            </motion.div>
            <motion.h2
              initial={{ opacity: 0, y: 20 }}
              animate={inView ? { opacity: 1, y: 0 } : {}}
              transition={{ duration: 0.8, delay: 0.2 }}
              className="text-5xl sm:text-6xl lg:text-7xl font-bold text-neutral-900 dark:text-white leading-none"
            >
              Featured
              <br />
              Campaigns
            </motion.h2>
          </div>

          {/* Projects Grid */}
          <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
            {projects.map((project, index) => (
              <motion.div
                key={project.title}
                initial={{ opacity: 0, y: 30 }}
                animate={inView ? { opacity: 1, y: 0 } : {}}
                transition={{ duration: 0.8, delay: 0.1 + index * 0.1 }}
                className="bg-white dark:bg-neutral-800 border border-neutral-200 dark:border-neutral-700 hover:border-neutral-300 dark:hover:border-neutral-600 transition-colors duration-300"
              >
                {/* Project Image */}
                <div className="relative h-48 bg-neutral-100 dark:bg-neutral-700">
                  <div className="absolute inset-0 flex items-center justify-center">
                    <span className="text-neutral-400 dark:text-neutral-500 text-lg">
                      Campaign Image
                    </span>
                  </div>
                  {project.featured && (
                    <div className="absolute top-4 left-4 bg-black dark:bg-white text-white dark:text-black px-3 py-1 text-sm font-medium">
                      Featured
                    </div>
                  )}
                </div>

                {/* Project Content */}
                <div className="p-6">
                  <h3 className="text-xl font-semibold text-neutral-900 dark:text-white mb-3">
                    {project.title}
                  </h3>
                  <p className="text-neutral-600 dark:text-neutral-300 mb-4 leading-relaxed">
                    {project.description}
                  </p>

                  {/* Technologies */}
                  <div className="flex flex-wrap gap-2 mb-6">
                    {project.technologies.map((tech) => (
                      <span
                        key={tech}
                        className="px-3 py-1 bg-neutral-100 dark:bg-neutral-700 text-neutral-700 dark:text-neutral-300 text-sm font-medium"
                      >
                        {tech}
                      </span>
                    ))}
                  </div>

                  {/* Project Links */}
                  <div className="flex space-x-4">
                    <motion.a
                      whileHover={{ scale: 1.05 }}
                      whileTap={{ scale: 0.95 }}
                      href={project.liveUrl}
                      className="flex items-center space-x-2 text-neutral-600 dark:text-neutral-400 hover:text-neutral-900 dark:hover:text-white transition-colors duration-200 font-medium"
                    >
                      <Eye size={16} />
                      <span>View Case Study</span>
                    </motion.a>
                  </div>
                </div>
              </motion.div>
            ))}
          </div>

          {/* View More Button */}
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.8 }}
            className="text-center mt-12"
          >
            <motion.button
              whileHover={{ scale: 1.02 }}
              whileTap={{ scale: 0.98 }}
              className="px-12 py-4 bg-black dark:bg-white text-white dark:text-black font-medium tracking-wide hover:bg-neutral-800 dark:hover:bg-neutral-200 transition-colors duration-300"
            >
              View All Work
            </motion.button>
          </motion.div>
        </motion.div>
      </div>
    </section>
  );
};

export default Projects;
